import streamlit as st
st.sidebar.image("thinh.gif", use_column_width=False)
## Hiển thị một đoạn văn bản dưới dạng markdown trong thanh bên. Đoạn văn bản này chứa thông tin về tác giả và một liên kết đến trang web của trường
st.sidebar.markdown("""
                    > Thực hiện: [*Nguyễn Sỹ Thịnh*](https://www.kgc.edu.vn/)
                    """)
## Tạo một chuỗi HTML chứa đoạn mã HTML để tạo tiêu đề của ứng dụng web. Đoạn mã HTML này bao gồm một tiêu đề, một màu nền và hình ảnh logo của trường được căn chỉnh bên phải của tiêu đề
col1, col2 = st.columns(2)
user_color      = '#000000'
title_webapp    = "Website điểm danh dùng webcam"
image_link      = "data:image/png;base64,"
html_temp = f"""
            <div style="background-color:{user_color};padding:12px">
            <h1 style="color:white;text-align:center;">{title_webapp}
            <img src = "{image_link}" align="right" width=150px ></h1>
            </div>
            """
## Hiển thị đoạn mã HTML trong thanh bên bằng cách sử dụng hàm markdown. Tham số unsafe_allow_html=True được sử dụng để cho phép Streamlit hiển thị nội dung HTML mà không bị hạn chế.
st.markdown(html_temp, unsafe_allow_html=True)
